// ? ensure every icon instance gets a unique ID suffix
let iconIdCounter = 0

/**
 * Retrieves an icon's SVG string and ensures any internal IDs are unique
 * to prevent rendering conflicts when the same icon is used multiple times
 * on the same page.
 * @param name The key of the icon to retrieve.
 * @returns The SVG string with unique IDs, or null if not found.
 */
export function getIcon(name: string): string | null {
  if (name in icons) {
    let svg = icons[name]
    // Check if the SVG contains an ID that might cause conflicts.
    const hasId = /id="[^"]+"/.test(svg)

    if (hasId) {
      const uniqueSuffix = `uid-${iconIdCounter++}`

      // Find all id="..." attributes and append the unique suffix.
      svg = svg.replace(/id="([^"]+)"/g, (_, id) => `id="${id}-${uniqueSuffix}"`)

      // Find all url(#...) references and append the unique suffix to match.
      svg = svg.replace(/url\(#([^"]+)\)/g, (_, id) => `url(#${id}-${uniqueSuffix})`)
    }

    return svg
  }

  console.warn(`Icon '${name}' not found.`)
  return null
}
